import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from './Home';
import About from './About';
import Contact from './Contact';
import Posts from './components/Posts';

function App() {
  return (
    <Routes>
      <Route path="/posts" element={<Posts />} />
    </Routes>
  );
}

export default App;
